import styled from "styled-components";

const Container = styled.div`
    position:absolute;
    background-color:#d5def5;
    display:flex;
    justify-content:space-around;
    flex-wrap.wrap;
`;

const ImgContainer = styled.div`
    width:250px;
    height:250x;
    background-color:red;
    margin:20px;

    img{
      width:100;
      height:100%;
      top:0;
      left:0;
      object-fit:cover;
    }
`;



function AnimalControl({item}) {
  return (
    <Container>
      <ImgContainer>
        <img src={item.Image}/>
      </ImgContainer>
    </Container>
     
  )
}

export default AnimalControl;
